(1, 'Infinity Workforce', 'home', NULL, '<p style=\"text-align: center;\"><span style=\"font-weight: bold;\"><span style=\"text-decoration: underline;\"><span style=\"color: rgb(0, 0, 0);\">INFINITY WORKFORCE</span></span></span></p><ul><li style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Are you looking for reliable staff to fulfill the project for your business?</span></li><li style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Are you an hard working and serious person and looking for a job?</span></li></ul><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">We provide labour hire services to many industries including Catering\r\n companies, Food factories, Construction Industries, Industrial \r\nFactories, Events Services, Warehouses, Security Services and Cleaning \r\nServices, to name a few. </span></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">We do the due diligence, individually assess \r\nall our recruits to make sure that they are legal and fit the Australian\r\n labour code so that you don’t have to.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Call us at 02 8041 691<br></span></p>', 0, 'job seeker, job sydney, working in sydney', '<p style=\"text-align: center;\"><span style=\"font-weight: bold;\"><span style=\"text-decoration: underline;\"><span style=\"color: rgb(0, 0, 0);\">INFINITY WORKFORCE</span></span></span></p><ul><li style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Are you looking for reliable staff to fulfill the project for your business?</span></li><li style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Are you an hard working and serious person and looking for a job?</span></li></ul><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">We provide labour hire services to many industries including Catering\r\n companies, Food factories, Construction Industries, Industrial \r\nFactories, Events Services, Warehouses, Security Services and Cleaning \r\nServices, to name a few. </span></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">We do the due diligence, individually assess \r\nall our recruits to make sure that they are legal and fit the Australian\r\n labour code so that you don’t have to.</span></p>\r\n<p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);\">Call us at 02 8041 691<br></span></p>', NULL, '18338173871.png', '2019-04-17 12:00:00', '2019-08-22 22:22:37'),
(2, 'About Us', 'about-us', 'banner-about-us.jpg', '<p style=\"line-height:1.2;margin-top:0pt;margin-bottom:8pt;\"><span style=\"font-family: undefined;\">﻿</span><font style=\"\" face=\"Calibri, sans-serif\"><span style=\"font-size: 18px; white-space: pre-wrap;\"><b>The Recruitment Specialist</b></span></font></p><p style=\"line-height:1.2;margin-top:0pt;margin-bottom:8pt;\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 18px; white-space: pre-wrap; font-family: Calibri, sans-serif;\">Infinity Workforce was founded when they started originally back then in 2006 offering quality, reliable and trusted employment services to Sydney based companies.</span></div><font face=\"Calibri, sans-serif\">\r\n<div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\">Building relationship between candidates and employers has always been a priority, Infinity Workforce has a strong reputation in the recruitment &amp; labour hire industry for having experienced consultants who understand the unique requirements of specific industry such as with food services, cleaning, construction, security, as well as nursing &amp; personal care</div><span style=\"font-size: 18px; white-space: pre-wrap;\">\r\nFinding skilled and well experienced recruitment &amp; labour hire personnel is now easier than ever. When you entrust your staffing requirements and let a specialised recruitment firm handle the tasks of recruiting the right people for your projects, you will be able to save your resources and focus on other important aspects of your business.\r\n</span><div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\">With our Sydney based office, our team offer specialised recruitment services spanning across a range of industries with a culture that is focused on exceptional recruitment service that take care of employers’ needs, creating lasting partnerships.</div><span style=\"font-size: 18px; white-space: pre-wrap;\">Through our dedicated labour hire specialist consultants, Infinity Workforce is able to deliver recruitment &amp; labour hire solutions that align with your corporate culture and also meet your technical requirements.\r\n</span><div style=\"text-align: justify;\"><span style=\"font-size: 18px; white-space: pre-wrap;\"><br></span></div></font><p></p><div></div>', 1, NULL, '<p style=\"line-height:1.2;margin-top:0pt;margin-bottom:8pt;\"><span style=\"font-family: undefined;\">﻿</span><font style=\"\" face=\"Calibri, sans-serif\"><span style=\"font-size: 18px; white-space: pre-wrap;\"><b>The Recruitment Specialist</b></span></font></p><p style=\"line-height:1.2;margin-top:0pt;margin-bottom:8pt;\"></p><div style=\"text-align: justify;\"><span style=\"font-size: 18px; white-space: pre-wrap; font-family: Calibri, sans-serif;\">Infinity Workforce was founded when they started originally back then in 2006 offering quality, reliable and trusted employment services to Sydney based companies.</span></div><font face=\"Calibri, sans-serif\">\r\n<div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\">Building relationship between candidates and employers has always been a priority, Infinity Workforce has a strong reputation in the recruitment &amp; labour hire industry for having experienced consultants who understand the unique requirements of specific industry such as with food services, cleaning, construction, security, as well as nursing &amp; personal care</div><span style=\"font-size: 18px; white-space: pre-wrap;\">\r\nFinding skilled and well experienced recruitment &amp; labour hire personnel is now easier than ever. When you entrust your staffing requirements and let a specialised recruitment firm handle the tasks of recruiting the right people for your projects, you will be able to save your resources and focus on other important aspects of your business.\r\n</span><div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\">With our Sydney based office, our team offer specialised recruitment services spanning across a range of industries with a culture that is focused on exceptional recruitment service that take care of employers’ needs, creating lasting partnerships.</div><span style=\"font-size: 18px; white-space: pre-wrap;\">Through our dedicated labour hire specialist consultants, Infinity Workforce is able to deliver recruitment &amp; labour hire solutions that align with your corporate culture and also meet your technical requirements.\r\n</span><div style=\"text-align: justify;\"><span style=\"font-size: 18px; white-space: pre-wrap;\"><br></span></div></font><p></p><div></div>', NULL, NULL, '2019-04-17 12:00:00', '2019-07-04 20:13:31'),
(3, 'Job Listings', 'job-listings', NULL, 'Desc', 1, NULL, NULL, NULL, NULL, '2019-04-17 12:00:00', NULL),
(4, 'Employers', 'employers', NULL, '<span id=\"docs-internal-guid-aa36744c-7fff-f56a-afe7-d0f15e0ef797\"><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:8pt;\"><font color=\"#000000\" face=\"Calibri, sans-serif\"><span style=\"white-space: pre-wrap;\">Dear clients,</span></font></p>\r\n\r\n<font face=\"Calibri, sans-serif\">\r\n<div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\">Infinity workforce specialises in providing custom recruitment &amp; HR solutions to a variety of industries all around Sydney, as well as some area in NSW Australia. Our aims is “Building relationships, and delivering results”! </div> <div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\"> Our retention of major clients over many years illustrates our ability to maintain a level of service that exceeds their expectations. When you come to us, we make sure your needs are put ahead of everything else so that you can rest at ease and run your business without having to worry about where to source your staff from. </div> <div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\"> We do comprehensive analysis of all the applications we receive, properly evaluate to check suitability for the jobs in question and make them available to you.</div> <div style=\"font-size: 18px; white-space: pre-wrap; text-align: justify;\"> Our clients include: » </div><div style=\"text-align: justify;\"><span style=\"font-size: 18px; white-space: pre-wrap;\">» Catering companies\r\n» Food factories\r\n» Cleaning services\r\n» Security services\r\n» Construction industries\r\n» Events services\r\n» Personal Care services\r\n» NDIS Carer services\r\n</span></div><div style=\"text-align: justify;\"><br></div></font></span>', 1, NULL, NULL, NULL, NULL, '2019-04-18 12:00:00', '2019-06-13 05:59:11'),
(5, 'Services', 'services', NULL, NULL, 1, NULL, NULL, NULL, NULL, '2019-05-04 18:00:00', '2019-05-05 08:37:42'),
