(31, 'If a delivery has 13 cartons per layer and is 8 cartons high, how many cartons there are per pallet?', '104', '21', '138', '114', '1', 5, NULL, 1, '2019-08-31 00:26:39', '2019-08-31 00:26:39'),
(32, 'We pack 24 sausage rolls per carton, how many cartons would we need to use for 192 sausage rolls?', '9', '8', '18', '184', '2', 5, NULL, 1, '2019-08-31 00:29:19', '2019-08-31 00:29:19'),
