(37, 'Which piece of jewelry can be worn by a foodhandler?', 'Diamond ring', 'hearrings', 'Plain metal wedding ring', 'Watch', '3', 2, NULL, 1, '2019-08-31 01:20:38', '2019-08-31 01:20:38'),
