(39, 'What should foodhandlers do after working with food and before using the restroom?', 'Wash their hands', 'Take off their hats', 'Change their gloves', 'Change their hats', '1', 2, NULL, 1, '2019-08-31 01:26:45', '2019-08-31 01:26:45'),
