(5, '2', 'Commercial cleaning services', 'b', '- CASUAL POSITION, HOURLY RATE, - SERIOUS & HARD WORKER - FAST PACED ENVIRONMENT  - GOOD ENGLISH SKILLS - MONDAY TO FRIDAY - ABOVE AWARDS RATES  LARGE AND WELL ESTABLISHED FOOD MANFACTURING S LOOKING FOR PRODUCTION LINE OPERATOR AND PACKING TEAM.  Please CONTACT us (Subject: FOOD MANUFACTURER PRODUCTION OPERATOR) & feel up the APPLICATION form above', '', 1, '2019-04-30 03:14:30', '2019-07-08 05:31:01', NULL),
(8, '2', 'House and strata cleaning', 'c', '- CASUAL POSITION, HOURLY RATE,\r\n- 4 TO 5 DAYS PER WEEK\r\n- MONDAY TO FRIDAY (35h+ per week)\r\n- GOOD ENGLISH SKILLS \r\n- PASTRY, DOUGH SHEETER PROCESS \r\n\r\nWe are looking for serious and experienced BAKER, PASTRY COOK for a large wholesale bakery factory \r\n \r\nPlease CONTACT us (Subject: BAKER & PASTRY POSITIONS) & feel up the APPLICATION form above   ', '', 0, '2019-04-30 04:17:23', '2022-03-21 17:48:13', NULL),
(9, '3', 'Food Process Worker (Location - Sutherland)', 'd', 'Currently looking for experienced and fresh candidates for our client\'s Food manufacturing factory located in Sutherland. Flexible work with good working hours. If Interested please call on 0423622821.', '', 1, '2019-04-30 04:47:24', '2022-03-22 11:51:47', NULL),
(10, '2', 'Gardening Services', 'gardening', 'How big your business is going to be depends on you, your free time, the scale of services you would offer and of course the money you can afford to invest. These are the basics on how to set up a gardening business.', '', 0, '2019-05-22 10:53:29', '2022-03-21 17:48:19', NULL),
