(12, '2', 'Commercial cleaning services', 'b', '- CASUAL POSITION, HOURLY RATE, - SERIOUS & HARD WORKER - FAST PACED ENVIRONMENT  - GOOD ENGLISH SKILLS - MONDAY TO FRIDAY - ABOVE AWARDS RATES  LARGE AND WELL ESTABLISHED FOOD MANFACTURING S LOOKING FOR PRODUCTION LINE OPERATOR AND PACKING TEAM.  Please CONTACT us (Subject: FOOD MANUFACTURER PRODUCTION OPERATOR) & feel up the APPLICATION form above', '', 0, '2019-04-30 03:14:30', '2019-09-04 04:48:08', NULL),
